code_str = ""
import gzip
import base64
import pandas as pd
import json

def decode_gzip_base64(encoded_str: str) -> str:
    # Base64 解码 ➡️ 二进制数据
    compressed_data = base64.b64decode(encoded_str)
    
    # GZIP 解压 ➡️ 原始内容
    decompressed_data = gzip.decompress(compressed_data)
    
    # 解码字节为字符串 (根据实际编码调整，默认utf-8)
    return decompressed_data.decode('utf-8')

# 使用示例

result = decode_gzip_base64(code_str)
df = pd.DataFrame(json.loads(result))
df.to_csv('code.csv', index=False)